    "2016-07-27T22:19:45.193812",nt"name": "regional-economic-benefits-of-ecotourism-and-operations-associated-with-the-malheur-nation",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of this report was to assess
    the role of the Malheur NWR in the economy of Harney County and the state of Oregon.
    This was accomplished in two stages. First, previous studies of the economic impact
    of the Malheur NWR and of other refuges were reviewed. Drawing upon the approaches
    and findings of those studies, the regional economic benefits of the Malheur NWR
    were evaluated using site-specific visitation, economic base information, and expenditure
    patterns.  This study found that visitor expenditures in the county were estimated
    to be more than $1.9 million annually.",nt"license_title": "License Not Specified",nt"extras":
